"use strict";document.addEventListener("DOMContentLoaded",function(){for(var t=new Date,e=document.querySelector("canvas"),n=e.getContext("2d"),o=0;o<e.width;o++)for(var d=0;d<e.height;d++){var a=Math.floor(255*Math.random())+1,m=Math.floor(255*Math.random())+1,h=Math.floor(255*Math.random())+1;n.fillStyle="rgb("+a+", "+m+", "+h+")",n.fillRect(o,d,1,1)}var r=new Date-t;document.getElementById("ms").textContent=r+"ms",document.getElementById("sec").textContent=r/1e3+"s",document.getElementById("width").textContent=e.width,document.getElementById("height").textContent=e.height,document.getElementById("elements").textContent=e.width*e.height+" elements"});